import * as React from 'react';
import { useState } from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import CssBaseline from '@mui/material/CssBaseline';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import AddIcon from '@mui/icons-material/Add';
import SearchIcon from '@mui/icons-material/Search';
import MoreIcon from '@mui/icons-material/MoreVert';
import Accordion from '@mui/material/Accordion';
import AccordionDetails from '@mui/material/AccordionDetails';
import AccordionSummary from '@mui/material/AccordionSummary';
import Typography from '@mui/material/Typography';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import './GeocacheAppBar.css';
import axios from 'axios'
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
// import { FixedSizeList } from 'react-window';

export default function GeocacheAppBar() {
  const [expanded, setExpanded] = React.useState(false);
  const [geocacheInfoOpened, setGeocacheInfoOpened] = React.useState(false);
  const [currPosition, setCurrPosition] = useState({ lat: 0, lng: 0 });
  const [foundWaypoints, setfoundWaypoints] = React.useState([]);

  navigator.geolocation.getCurrentPosition((position) => {
    setCurrPosition({ lat: position.coords.latitude, lng: position.coords.longitude });
  });

  const handleChange = (panel) => (event, isExpanded) => {
    setExpanded(isExpanded ? panel : false);
  };

  async function getFoundWaypoints() {
    await axios.get('http://localhost:5000/geocacheFoundWaypoints').then(response => {
      console.log("SUCCESSGETHERE", response.data.message)
      setfoundWaypoints(response.data.message);
    }).catch(error => {
      console.log(error)
    })
  };

  function renderRow() {

    return (
      <ListItem component="div" disablePadding>
        <ListItemButton>
          <ListItemText primary={`Item ${1}`} />
        </ListItemButton>
      </ListItem>
    );
  }

  function geocacheInfo() {
    return (
      <div>
        <Accordion expanded={expanded === 'panel1'} onChange={handleChange('panel1')}>
          <AccordionSummary
            expandIcon={<ExpandMoreIcon />}
            aria-controls="panel1bh-content"
            id="panel1bh-header"
          >
            <Typography id="accordionText">
              What is Geocaching?
            </Typography>
          </AccordionSummary>
          <AccordionDetails>
            <Typography>
              Geocaching is an outdoor activity where you (the participant) use a GPS feature to locate "caches",
              which are usually weather resistant containers with various objects hidden inside. You can locate yourself
              on the map as the green checker marker on the map. The caches are indicated as red markers on the map.
              Click on the cache to find the name and the location of the cache. You can view your current live location
              on the top of the page, with the longitude and latitude values. Try browsing around the map!
            </Typography>
            <br />
            <Typography>
              Upon finding a cache, you may click on the marker on the map and click "Found!" to record the cache.
              You can then open the drop down below ("Personal Cache Record").
            </Typography>
          </AccordionDetails>
        </Accordion>
        <Accordion expanded={expanded === 'panel4'} onChange={handleChange('panel4')}>
          <AccordionSummary
            expandIcon={<ExpandMoreIcon />}
            aria-controls="panel4bh-content"
            id="panel4bh-header"
          >
            <Typography id="accordionText" >Personal Cache Record</Typography>
          </AccordionSummary>
          <AccordionDetails>
            <List
             style={{maxHeight: '100%', overflow: 'auto'}}
                  subheader={<li />}
            >
        { getFoundWaypoints()}
        {[0, 1, 2, 3, 4].map((sectionId) => (

              [0, 1, 2].map((item) => (
                <ListItem key={`item-${sectionId}-${item}`}>
                  <ListItemText primary={`Item ${item}`} />
                </ListItem>
              ))

        ))}

            </List>
            {/* <Typography>
              Nunc vitae orci ultricies, auctor nunc in, volutpat nisl. Integer sit
              amet egestas eros, vitae egestas augue. Duis vel est augue.
            </Typography> */}
          </AccordionDetails>
        </Accordion></div>);
  }

  return (
    <React.Fragment>
      <CssBaseline />
      {/* <Paper square sx={{ pb: '50px' }}>
          <Typography variant="h5" gutterBottom component="div" sx={{ p: 2, pb: 0 }}>
            Inbox
          </Typography>
          <List sx={{ mb: 2 }}>
            {messages.map(({ id, primary, secondary, person }) => (
              <React.Fragment key={id}>
                {id === 1 && (
                  <ListSubheader sx={{ bgcolor: 'background.paper' }}>
                    Today
                  </ListSubheader>
                )}
                {id === 3 && (
                  <ListSubheader sx={{ bgcolor: 'background.paper' }}>
                    Yesterday
                  </ListSubheader>
                )}
                <ListItem button>
                  <ListItemAvatar>
                    <Avatar alt="Profile Picture" src={person} />
                  </ListItemAvatar>
                  <ListItemText primary={primary} secondary={secondary} />
                </ListItem>
              </React.Fragment>
            ))}
          </List>
        </Paper> */}
      <AppBar id="appBar" position="fixed" color="primary">
        <Toolbar>
          <h1 id="title">Geocacher</h1>
          <div id="currentLocation">
            <h3 id="locationText">Current Location</h3>
            <h3 id="locationText">Latitude: {currPosition.lat !== 0 ? currPosition.lat : null}</h3>
            <h3 id="locationText">Longitude: {currPosition.lng !== 0 ? currPosition.lng : null}</h3>
          </div>
          {/* <StyledFab color="secondary" aria-label="add">
              <AddIcon />
            </StyledFab> */}
          <Box id="box" />
          {/* <IconButton color="inherit">
              <SearchIcon />
            </IconButton> */}
          <IconButton color="inherit" onClick={() => setGeocacheInfoOpened(!geocacheInfoOpened)} >
            <MenuIcon />
          </IconButton>
        </Toolbar>
        {geocacheInfoOpened ? geocacheInfo() : null}
      </AppBar>
    </React.Fragment>
  );
}
